// 4. 异步解密函数
// ==========================================

async function decrypt(inputObj) {
    if (!responseModifier) return null;

    try {
        console.log("[-] VM 正在执行...");
        
        // 关键点：因为返回的是 Promise，必须 await
        const resultPromise = responseModifier(inputObj);
        
        // 等待 VM 异步操作完成
        const result = await resultPromise;
        
        return result || inputObj;
    } catch (e) {
        console.error("[!] Execution Error:", e);
        return null;
    }
}

